import React from "react";
import "./formPage.styles.scss";
import FormSidebarMenu from "../../component/form-topbar-menu/form-topbar-menu.component";
import FormTopbarMenu from "../../component/form-sidebar-menu/form-sidebar-menu.component";
const FormPage = () => {
	return (
		<div className="form-page">
			<FormSidebarMenu />
			<FormTopbarMenu />
		</div>
	);
};

export default FormPage;
